import React from 'react';
import './custom-button.styles.scss';

const CustomButton = ({ children, isGoogleSinIn, ...otherProps }) => (
  <button
    className={`${isGoogleSinIn ? 'google-sign-in' : ''} custom-button`}
    {...otherProps}
  >
    {children}
  </button>
);

export default CustomButton;
